import logo from "./logo.svg";
import "./App.css";

function App() {
  return <Layout />;
}

function Layout() {
  const object = [
    {
      title: "리액트 공부하기",
      content: "리액트 기초를 공부해봅시다",
      key: 1,
      isdone: false,
    },
    { title: "리액트", content: "리액트 기초", key: 12, isdone: true },
  ];
  return (
    <div className="layout">
      <Header />
      <Form />
      <List
        title="Working"
        a={object.filter((e) => !e.isdone)}
        key={object.key}
      />
      <List title="Done" a={object.filter((e) => e.isdone)} key={object.key} />
    </div>
  );
}

function Header() {
  return (
    <div className="header">
      <p>My Todo List</p>
      <p>React</p>
    </div>
  );
}

function Form() {
  return (
    <>
      <div className="form">
        <label>제목</label>
        <input type="text" />
        <label>내용</label>
        <input type="text" />
        <input type="submit" className="add" value="추가하기"></input>
      </div>
    </>
  );
}

function List({ title, a, key }) {
  return (
    <>
      <div className="title">
        <span>{title}</span>
        {a.map((e) => (
          <Todo b={e} key={e.key} />
        ))}
      </div>
    </>
  );
}

function Todo({ b }, { key }) {
  return (
    <>
      <div className="todo">
        <h2>{b.title}</h2>
        <span>{b.content}</span>
        <div className="btn">
          <button className="btn1">삭제하기</button>
          <button className="btn2">{b.isdone ? "취소" : "완료"}</button>
        </div>
      </div>
    </>
  );
}

export default App;
